MAMapView mapView = null;
public override void ViewDidLoad()
{
    base.ViewDidLoad();
    Thinkpower.BindingIOS.AMap_Map.MAMapServices.SharedServices().ApiKey = "Your-Key";
    mapView = new MAMapView()
    {
        Frame = this.View.Bounds,
        Delegate = new MAMapViewDelegate(),
    };
    this.View.AddSubview(mapView);
}
